    // 获取CF请求头IP所属国家
    const ip_country_header = request.headers.get('cf-ipcountry');
    const region = ip_country_header ? ip_country_header.toUpperCase() : '';
    // 获取CF请求头IP
    const ip_address_header = request.headers.get('cf-connecting-ip');
    const ip_address = ip_address_header ? ip_address_header : '';

    // 原始URL对象
    let original_url = new URL(request.url);

    // 获取用户输入的url
    let url = original_url.search.substring(original_url.search.indexOf('=') + 1);
